import React from 'react'
import { Link } from 'react-router-dom'

const NotFoundPage = () => {
  const accessToken = localStorage.getItem('accessToken');
  const isAuthenticated = !!accessToken; // Double negation to convert truthy/falsy to boolean

  return (
    <div className='page_not_round'>
      <h1>Page Not Found</h1>
      {isAuthenticated ? (<Link to="/dashboard">Please go to Dashboard</Link>) : (<Link to="/login">Please Login to continue</Link>)}
    </div>
  )
}

export default NotFoundPage
